          }
        },
        "required": [
          "task"
        ]
      },
      "description": "要执行的函数分析任务列表。"
    },
    "run_in_background": {
      "type": "boolean",
      "description": "是否在后台运行此任务。",
      "default": false
    }
  },
  "required": [
    "tasks"
  ]
}

